import React, { useEffect, useState } from 'react';

export default function Players() {

    const [state, setState] = useState([])
    useEffect(() => {
        fetch("https://localhost:5001/Players").then(
            res => setState(res)
        )
    });

    return (
        <>
            <h1>Players:</h1>
            {state.map( d => <div>{d}</div>)}
        </>
    );
}
